import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import SquatIcon from '../icon/squat-icon.png'

class RankingMenu extends Component {
  render() {
    return (
      <div>
        <nav>
          <div className="nav-wrapper deep-orange lighten-1">
            <ul
              style={{
                display: 'flex',
                justifyContent: 'space-between',
                alignItems: 'center',
              }}
            >
              <Link
                style={{
                  color: '#fff',
                  textDecoration: 'none',
                  listStyle: 'none',
                  fontSize: '20px',
                }}
                to="/squat-ranking"
              >
                <li>
                  <img
                    src={SquatIcon}
                    alt="squat icon"
                    className="responsive-img"
                    style={{ width: '30px', height: '30px' }}
                  />
                </li>
              </Link>
              <Link
                style={{
                  color: '#fff',
                  textDecoration: 'none',
                  listStyle: 'none',
                  fontSize: '20px',
                }}
                to="/push-up-ranking"
              >
                <li>Push Up</li>
              </Link>
              <Link
                style={{
                  color: '#fff',
                  textDecoration: 'none',
                  listStyle: 'none',
                  fontSize: '20px',
                }}
                to="/pull-up-ranking"
              >
                <li>Pull Up</li>
              </Link>
              <Link
                style={{
                  color: '#fff',
                  textDecoration: 'none',
                  listStyle: 'none',
                  fontSize: '20px',
                }}
                to="/arm-curl-ranking"
              >
                <li>Arm Curl</li>
              </Link>
              <Link
                style={{
                  color: '#fff',
                  textDecoration: 'none',
                  listStyle: 'none',
                  fontSize: '20px',
                }}
                to="/dumbbell-raise-ranking"
              >
                <li>Dumbbell Raise</li>
              </Link>
            </ul>
          </div>
        </nav>
      </div>
    )
  }
}

export default RankingMenu
